INSERT INTO `projeto_observacao` (`id`, `colaborador_id`, `conteudo`, `projeto_id`, `created_at`, `updated_at`, `created_by`, `created_by_name`, `updated_by`, `updated_by_name`, `active`, `deleted_at`) VALUES
	(1, 1, '<p>gtestes</p>', 4, '2023-10-18 15:57:11', '2023-10-18 16:03:35', '1', 'root', NULL, NULL, 1, '2023-10-18 16:03:35'),
	(2, 1, '<p>teste</p>', 4, '2023-10-18 16:03:39', '2023-10-18 16:03:39', '1', 'root', NULL, NULL, 1, NULL),
	(3, 26, '<p>Teste ativo</p>', 4, '2023-10-21 00:34:34', '2023-10-21 00:34:34', '21', 'Lucas da Mota Marques', NULL, NULL, 1, NULL),
	(4, 20, '<p>Projeto baseado em Framework PHP (Codeigniter 4.4)</p><p><br></p><p>Repositório atualizado: </p><p>http://10.11.62.153:8081/dss/intranet-degase</p><p><br></p><p>Banco de Dados: </p><pre class="ql-syntax" spellcheck="false">IP do Servidor: 10.11.63.137\nDadaBase: Intranet_DEGASE\n</pre><p><br></p>', 1, '2023-10-23 21:21:21', '2023-10-23 21:21:21', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(5, 20, '<p>ATENÇÃO:</p><p><br></p><p>A GAR ainda não atualizou o TAP com a área administrativa nem com os aplicativos de Agendamento e Controle de Frotas.</p>', 1, '2023-11-05 21:11:16', '2023-11-05 21:11:16', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(6, 20, '<p>[GLPI #0097985] - Deploy Total para correção de Links</p>', 12, '2023-11-06 10:55:11', '2023-11-06 10:55:11', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(7, 20, '<p><strong>Mensagem ao GFS:</strong></p><p><br></p><p>Aguardando TESTES da GAR, após realização do DEPLOY. </p>', 12, '2023-11-06 23:43:48', '2023-11-06 23:43:48', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(8, 20, '<p>Remarcado de ontem as 17hs para hoje as 16hs o suporte do JM, relacionado ao HTTPS do SISCOM. Para que o Cliente possa testar as observações levantadas por e-mail.</p>', 10, '2023-11-07 13:14:03', '2023-11-07 13:14:03', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(9, 20, '<p>Certificado com problemas</p><p>Endereço para acesso ao Webmail</p>', 1, '2023-11-22 19:59:35', '2023-11-22 19:59:35', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(10, 20, '<p>Aguardando o segundo TAP para iniciar o desenvolvimento.</p>', 1, '2023-11-29 10:09:10', '2023-11-29 10:09:10', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(11, 15, '<p>O card de desenvolvimento, do slide cards de tarefas, não aparece em telas medias como notebook, por exemplo, aprece apenas de homologação em diante.</p>', 1, '2023-11-29 14:07:39', '2023-11-29 14:07:39', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
	(12, 20, '<p>Banco HML não possui consumo com aplicação em PRD. </p><p>Não existe aplicação HML para testes. </p><p><br></p><p>Considerar todos os testes em PRD como versão BETA.</p>', 2, '2023-12-07 00:19:14', '2023-12-07 00:19:14', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(13, 15, '<p>Primeira migração utilizando novo servidor de arquivos para os sites Drupal.</p>', 32, '2023-12-08 13:45:10', '2023-12-08 13:45:10', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
	(14, 31, '<p>Conforme email, o site está parado devido a ausência de resposta do cliente em relação ao campo de rede social</p>', 34, '2024-01-08 10:34:21', '2024-01-08 10:34:21', '26', 'Pedro Gomes Vieira Mazone', NULL, NULL, 1, NULL),
	(15, 31, '<p>teste</p>', 34, '2024-01-08 10:34:45', '2024-01-08 10:34:45', '26', 'Pedro Gomes Vieira Mazone', NULL, NULL, 1, NULL),
	(16, 2, '<p>Este é mais um teste para verificar porque toda observação está sendo criado como se fosse uma observação criada pelo Bruno Leão, que nem está no Projeto.</p>', 34, '2024-01-08 11:03:39', '2024-01-08 11:03:39', '2', 'João Carlos Pirassinunga', NULL, NULL, 1, NULL),
	(17, 2, '<p>Este é um novo teste para verificar que agora está abrindo a observação com o colaborador certo.</p>', 34, '2024-01-08 11:31:41', '2024-01-08 11:32:17', '2', 'João Carlos Pirassinunga', NULL, NULL, 1, '2024-01-08 11:32:17'),
	(18, 20, '<p>Até o PRESENTE MOMENTO não temos Documento sobre :</p><p>Notícias;</p><p>Menu;</p><p>Rodapé;</p><p>Gerenciamento de ícones;</p><p>Integração com SSO;</p>', 1, '2024-02-02 10:45:37', '2024-02-02 10:45:37', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(19, 20, '<p>Projeto em Produção seguindo o ciclo de atualizações evolutivas e ajustes de regras de negócio que não atendem mais aos requisitos funcionais. </p>', 13, '2024-02-16 08:48:41', '2024-02-16 08:48:41', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(20, 20, '<p>http://10.11.62.153:8081/dss/intranetdegase/-/tree/DEV/Documentacao/DocumentacaoTecnica</p><p>A Evolução da Documentação pode ser encontrada no link acima!</p>', 1, '2024-02-22 07:54:16', '2024-02-22 07:54:16', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(21, 20, '<p>Documentação encontra-se no endereço: http://10.11.62.153:8081/dss/qlikadmin/-/tree/DEV/</p>', 13, '2024-02-29 08:25:43', '2024-02-29 08:25:43', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(22, 15, '<p>O repositório do Gitlab guarda apenas o código fonte do sistema. Qualquer alteração deverá ser feita no servidor juruvaruiva (10.11.62.131).</p><p>URL hml: https://gestaodefrotas.proderj.rj.gov.br/</p>', 112, '2024-03-14 11:14:14', '2024-08-07 10:48:51', '10', 'Elaine Delgado Alves', NULL, NULL, 1, '2024-08-07 10:48:51'),
	(23, 20, '<p>Observação ao PROJETO. </p><p>Até o presente momento foram realizadas 3 permissões de DEPLOY do ZELMO, porem nenhum acompanhamento ou teste, conforme o padrão de ser passado a GAR. </p><p>Os três DEPLOYs deram problemas, ou algo que o cliente não deseja ou recebeu alguma função que não teve uma utilização esperada. </p><p>Observações foram refatoradas e Testadas pela GFS, aguardando pedido de DEPLOY em PRD com as Observações atendidas. </p>', 1, '2024-06-11 10:27:43', '2024-06-11 10:27:43', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(24, 20, '<p>Sistema passará por Atualização de Linguagem de Programação PHP 8.1 ou Superior</p><p>Framework Codeigniter 4.2 ou Superior</p><p>Adaptação para aceitar telas do QLIK SENSE ENTERPRISE</p><p>Substituição de Telas para React/CDN, Babel e JSX. </p><p>Filtro de estrutura para Facilitar Manutenções do sistema com S.O.L.ID.</p>', 13, '2024-06-11 10:47:16', '2024-06-11 10:47:16', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(25, 15, '<p>Repositório do projeto: http://www.gitlab.proderj.rj.gov.br:8081/gest-o-de-frotas/conectaweb-cod-fonte</p><p><br></p><p>O desenvolvedor deve clonar o projeto no repositório acima e criar uma branch para desenvolver.</p><p>As alterações, quando finalizadas, devem ser mergeads na branch de homologação, a branch \'hml\' e solicitar o deploy no servidor juruvaruiva (IP: IP: 10.11.62.131 pasta h_gestaodefrotas).</p><p><br></p><p><strong>As branches hml e main não devem ser alteradas diretamente</strong>. Essas são branches de deploy e devem conter apenas o código que  estão no sistema no respectivos ambientes (homologação e produção).</p><p><br></p>', 112, '2024-08-07 15:23:38', '2024-08-07 15:23:38', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL);
