	(1347, 112, 7, 2, 'Fase 2 -REQ-37: Cadastro DVO', 'Cadastro DVO - O cadastro atual de DVO será mantido para cadastrar as sub-classificações, porém, ao cadastrar uma sub-classificação, deverá ser possível adicionar uma classificação como parent (pai) para ela em forma de dropdown.', NULL, NULL, NULL, NULL, NULL, '2024-10-04 09:00:00', '2024-10-08 18:00:00', '2024-10-04 10:00:00', '2024-10-08 18:00:00', 1, NULL, NULL, 16, 8, '2024-09-30 13:31:26', '2024-10-16 14:09:57', '10', 'Elaine Delgado Alves', '18', 'Kaylan Rocha Freitas Rosa', 1, NULL),
	(1348, 112, 7, 1, 'Fase 2 -REQ-38: Versão/DVO', 'Versão /DVO- O campo Versão /DVO na tela de cadastro de veículos deverá ser removido. Será adicionado novo campo para preenchimento da sub-classifição', NULL, NULL, NULL, NULL, NULL, '2024-09-30 13:31:00', '2024-10-22 13:32:00', NULL, NULL, 0, NULL, NULL, 1, 8, '2024-09-30 13:32:07', '2025-03-25 14:58:25', '10', 'Elaine Delgado Alves', '18', 'Kaylan Rocha Freitas Rosa', 1, NULL),
	(1349, 112, 7, 1, 'Fase 2 - REQ-39: Sub-classificação', 'Sub-classificação - Deverá ser adicionado um campo, ao lado do campo \'Classificação\' para que seja selecionada a Sub-classificação. O select deverá retornar apenas os children (filhos) da Classificação escolhida no campo anterior.', NULL, NULL, NULL, NULL, NULL, '2024-09-30 13:32:00', '2024-10-22 13:32:00', NULL, NULL, 0, NULL, NULL, 2, 8, '2024-09-30 13:32:59', '2025-03-25 14:58:25', '10', 'Elaine Delgado Alves', '18', 'Kaylan Rocha Freitas Rosa', 1, NULL),
	(1350, 112, 7, 1, 'Fase 2 - REQ-40: Cadastro de Modelo Veículos', 'Cadastro de Modelo Veículos -  Incluir campo Motor/Cc (alterar nome para Potencia/cilindrada)', NULL, NULL, NULL, NULL, NULL, '2024-09-30 13:33:00', '2024-10-22 13:33:00', NULL, NULL, 0, NULL, NULL, 3, 8, '2024-09-30 13:34:04', '2025-03-25 14:58:25', '10', 'Elaine Delgado Alves', '18', 'Kaylan Rocha Freitas Rosa', 1, NULL),
	(1351, 112, 7, 1, 'Fase 2 - REQ-41: Modelo e Versão de Veículo', 'Modelo e Versão de Veículo - O cadastro de Modelo e Versão de Veículo serão incluídos no mesmo campo \'Modelo\' na tela de cadastro "Modelo Versão Base". A versão não será mais adicionada separadamente no campo \'Adicionar\' atual', NULL, NULL, NULL, NULL, NULL, '2024-09-30 13:34:00', '2024-10-22 13:34:00', NULL, NULL, 0, NULL, NULL, 4, 8, '2024-09-30 13:34:30', '2025-03-25 14:58:25', '10', 'Elaine Delgado Alves', '18', 'Kaylan Rocha Freitas Rosa', 1, NULL),
	(1352, 112, 7, 1, 'Fase 2 - REQ-42: Modelo Veículo no DVO', 'Modelo Veículo no DVO - Essa funcionalidade deve ser extinta visto que os modelos e versões não deverão ter relação com as sub-classes.', NULL, NULL, NULL, NULL, NULL, '2024-09-30 13:34:00', '2024-10-22 13:34:00', NULL, NULL, 0, NULL, NULL, 5, 8, '2024-09-30 13:35:05', '2025-03-25 14:58:25', '10', 'Elaine Delgado Alves', '18', 'Kaylan Rocha Freitas Rosa', 1, NULL),
