	(1, 20, '<p>No GitLab. http://10.11.62.153:8081/dss/intranet-degase</p><p>Comando para executar: docker up --build -d</p><p>Conhecimentos: </p><ul><li>Codeigniter 4; e</li><li>Docker.</li></ul>', 24, '2023-10-23 21:31:27', '2023-10-23 21:31:27', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(2, 20, '<p>No GitLab. http://10.11.62.153:8081/dss/intranet-degase</p><p>Comando para executar: docker up --build -d</p><p>Conhecimentos: </p><ul><li>Codeigniter 4; e</li><li>Docker.</li></ul>', 24, '2023-10-23 21:31:27', '2023-10-23 21:31:27', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(3, 20, '<p>No GitLab. http://10.11.62.153:8081/dss/intranet-degase</p><p>Comando para executar: docker up --build -d</p><p>Conhecimentos: </p><ul><li>Codeigniter 4; e</li><li>Docker.</li></ul>', 24, '2023-10-23 21:31:29', '2023-10-23 21:31:29', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(4, 20, '<p>Conhecimentos: </p><ul><li>Codeigniter 4</li><li>Postman ou outro cliente de API</li></ul><p><br></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/principal/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/principal/api/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/principal/endpoint/(:any)</span></p><p>Serviços internos ao usuário (GTC, SSO, AD, etc):</p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/login/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/autenticar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/criar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/listar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/atualizaar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/deletar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/api/limpar/(:any)</span></p><p>Endpoints aos usuários externos:</p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/endpoint/login/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/endpoint/criar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/endpoint/listar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/endpoint/atualizar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/endpoint/deletar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/usuario/endpoint/limpar/(:any)</span></p><p>Serviços internos para Notícias</p><p><span style="color: rgb(124, 166, 104);"># www/intranet/noticia/api/criar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/comunicado/api/listar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/comunicado/api/atualizaar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/comunicado/api/deletar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/comunicado/api/limpar/(:any)</span></p><p>Enpoints de noticias para consumo externo</p><p><span style="color: rgb(124, 166, 104);"># www/intranet/noticia/endpoint/criar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/noticia/endpoint/listar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/noticia/endpoint/atualizaar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/noticia/endpoint/deletar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/noticia/endpoint/limpar/(:any)</span></p><p>Serviços internos de calendário (agenda)</p><p><span style="color: rgb(124, 166, 104);"># www/intranet/calendario/api/criar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/calendario/api/listar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/calendario/api/atualizaar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/calendario/api/deletar/(:any)</span></p><p><span style="color: rgb(124, 166, 104);"># www/intranet/calendario/api/limpar/(:any)</span></p>', 25, '2023-10-23 21:55:52', '2023-10-23 21:55:52', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(5, 20, '<p>C - Insert</p><p>R - Listar</p><p>U - Atualizar</p><p>D - Excluir tornar inativo</p><p><br></p><p>Clear - Limpar inativos definitivamente</p>', 26, '2023-10-23 22:01:37', '2023-10-23 22:01:37', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(6, 24, '<p>Aguardando o pessoal gerar as chaves da api para finalizar a integração.</p>', 28, '2023-10-24 13:30:26', '2023-10-24 13:30:26', '19', 'Leonardo dos Santos Costa', NULL, NULL, 1, NULL),
	(7, 30, '<p>Elaborar novas funcionalidades do projeto</p>', 32, '2023-10-30 20:00:57', '2023-10-30 20:00:57', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(8, 30, '<p>Analisando possíveis possibilidades que estão fazendo com que o portão não responda corretamente.</p><p><br></p><p>Analisando junto ao pessoal envolvido com a redhat</p>', 34, '2023-11-01 00:34:09', '2023-11-01 00:34:09', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(9, 30, '<p>Adicionando novas funcionalidades para realizar mais de um tipo de busca dentro do sistema</p>', 35, '2023-11-01 01:13:45', '2023-11-01 01:13:45', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(10, 20, '<p>Completo</p>', 40, '2023-11-04 21:12:59', '2023-11-04 21:12:59', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(11, 20, '<p>Completo</p>', 41, '2023-11-04 21:16:31', '2023-11-04 21:16:31', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(12, 20, '<p>03 - Mudança de conexão com banco de dados. ERRO</p><p>04 - Configuração de config/database.php. Sucesso</p><p>05 - Tarefa do Thiago recebido com relatório de Teste</p><p>06 - Erro do perfil do usuário. Corrigido</p>', 63, '2023-11-05 22:58:38', '2023-11-05 22:58:38', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(13, 20, '<p><br></p><p>09 - Mudança de Rotas dentro do novo ambiente de Migração</p><p>10 - Erro entre ambiente de Admin e Ambiente de Perfil do usuário</p><p>11 - Atualização de Avaliação dentro do novo Ambiente</p><p>12 - Teste com novo banco de dados. ERRO</p><p>13 - Teste de Cadastro de novo proponente. Sucesso.</p><p>14 - Criação de container com nova configuração VHOST</p>', 64, '2023-11-05 23:02:15', '2023-11-05 23:02:15', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(14, 20, '<p>17 - Reunião com GAR e INFRA</p><p>18 - Informações para abertura de Chamado</p><p>19 - Teste de Servidor FTP com pasta do PROJETO</p><p>20 - Teste de Infra ERRO permissão</p><p>21 - Autoirização de Permissão de Pasta</p>', 65, '2023-11-05 23:06:16', '2023-11-05 23:06:16', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(15, 20, '<p>24 - Teste de URL - ERRO</p><p>25 - Informação Lenize</p><p>26 - Erro de PHP</p><p>27 - Teste de permissão de Pasta</p><p>28 - Adicionar File Server</p><p>29 - Informação Lenize</p><p>30 - Teste de PHP Info</p><p><br></p>', 66, '2023-11-05 23:10:13', '2023-11-05 23:10:13', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(16, 20, '<p>33 - Configurações de novo ambiente</p><p>34 - Exportação das APIs para teste</p><p>35 - Teste de APIs em HML - FALHA</p><p>36 - Conteinirização do servicoapi com o FUNARJ</p><p>37 - Criação de dois ambientes compartilhando o mesmo volume de upload</p><p>38 - Informação Diego</p><p>39 - Informação Ricardo</p><p><br></p>', 67, '2023-11-05 23:13:35', '2023-11-05 23:13:35', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(17, 20, '<p>42 - Informação GAR ambiente de HML já pode ser atualizado para PRD</p><p>43 - Backup do docker-compose.yml</p><p>44 - Dowload do Codigo fonte para ambiente de desenvolvimento</p><p>45 - Comparação e analise de Codigo para aatualização</p><p>46 - Analise de DOcumentação com requisitos não funcionais</p><p>47 - COnteinerização Docker da Aplicação em Desenvolvimento - ERRO de PDO DB</p><p>48 - Atualização de Container com Driver SQLSRV - FALHA</p><p><br></p>', 68, '2023-11-05 23:17:40', '2023-11-05 23:17:40', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(18, 20, '<p>51 - Atualização de Constantes de ambiente</p><p>52 - Atualização de Autoload do SIstema</p><p>53 - Atualização de ROtas do Sistema</p><p>54 - Teste utilizando Laragon (Ainda com falha em docker)</p><p>55 - Deploy para Homologação</p><p>56 - Testes gerais no Sistema</p><p>57 - Erro de Ambiente</p><p><br></p>', 69, '2023-11-05 23:26:37', '2023-11-05 23:26:37', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(19, 20, '<p>60 - Suporte Lenize</p><p>61 - Alterações de Código para teste com IP</p><p>62 - Gerar E-mail as Gerencias</p><p>63 - Abrir Atende com dados de Deploy</p><p>64 - Gerar e-mail com testes </p><p>65 - Gerar e-mail Aviso ao Administrador do GTC</p><p><br></p>', 70, '2023-11-05 23:29:26', '2023-11-05 23:29:26', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(20, 20, '<p>68 - Gerar e-mail de confirmação com a Gerencia de Banco</p><p>69 - Criação de nova área de atualização de Upload unificado no fileserver</p><p>70 - Adaptação de validação de upload para integração com dois ambientes</p><p>71 - Desenvolvimento de nova rota para unificar os dois ambientes</p><p>72 - Teste por IP</p><p>73 - Informação Lenise</p><p>74 - Teste de DNS - Respondendo</p><p><br></p>', 71, '2023-11-05 23:35:43', '2023-11-05 23:35:43', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(21, 20, '<p>79 - Refatorar Constantes do novo ambiente</p><p>80 - Aplicar filtros de Segurança</p><p>81 - Em localhost Testes Ok</p><p>82 - Em localhost atualização de Rotas - Ok</p><p>83 - Em localhost atualização de filtros - Ok</p><p>84 - Em localhost atualização de segurança&nbsp;- Ok</p><p>85 - Em HML mesmo problema</p><p><br></p>', 72, '2023-11-05 23:38:09', '2023-11-05 23:38:09', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(22, 20, '<p>88 - Nova Pata com link Simbolico - INFRA TESTADO</p><p>89 - Novo compartilhamento com servico de editais mesmo link - OK</p><p>90 - Redirecionamento de servico sistemaeditais para servico API - Ok</p><p>91 - Teste de Redirecionamento GTC em HML</p><p><br></p>', 73, '2023-11-05 23:41:36', '2023-11-05 23:41:36', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(23, 26, '<p>aguardando api receber deploy</p>', 81, '2023-11-07 13:16:41', '2023-11-07 13:16:41', '21', 'Lucas da Mota Marques', NULL, NULL, 1, NULL),
	(24, 30, '<p>Desenvolvimento em php do sistema</p>', 85, '2023-11-07 14:00:49', '2023-11-07 14:00:49', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(25, 30, '<p>Criando exceptions para a consulta</p>', 85, '2023-11-07 14:02:32', '2023-11-07 14:02:32', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
