	(27, 30, '<h5>Conhecimentos</h5><p>OpenShift</p><p>Pipeline</p><p>Colocando sistema no servidor de produção da redhat usando o openshift </p>', 88, '2023-11-07 20:17:11', '2023-11-07 20:17:11', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(28, 20, '<p>Novo Carrossel compatível com react;</p><p>Carregamento de Noticias</p><p>Input de notícias</p>', 90, '2023-11-22 19:57:49', '2023-11-22 19:57:49', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(29, 20, '<p>Mensagem não aparecia antes da segunda liberação do TJ;</p><p>Hoje o sistema passou da mensagem de "falha de autenticação" para "processo não encontrado";</p><p>Solicitação EXTRA atendida e com CHAMADO para DEPLOY PARCIAL. </p>', 94, '2023-11-23 21:56:18', '2023-11-23 21:56:18', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(30, 20, '<p>EVOLUTIVE_UPDATE - Em BackEnd;</p><p>EVOLUTIVE_UPDATE - Em rotas; </p><p>EVOLUTIVE_UPDATE - Em Banco de dados; </p><p>EVOLUTIVE_UPDATE - FrontEnd; </p><p><br></p><p>Chamado - ID 99329 (Proderj &gt; PRODERJ)</p><p>Alteração de Tabela de LOG&nbsp;do&nbsp;QLIKADMIN</p><p><br></p><p>Chamado - ID 99331 (Proderj &gt; PRODERJ)</p><p>Alteração de Data de Conclusão e&nbsp;LOG&nbsp;de&nbsp;Usuário.</p>', 95, '2023-11-23 22:01:41', '2023-11-23 22:01:41', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(31, 26, '<p><img src="data:image/png;base64,"></p>', 98, '2023-11-24 20:17:08', '2023-11-24 20:17:08', '21', 'Lucas da Mota Marques', NULL, NULL, 1, NULL),
	(32, 20, '<p>Link 1) https://servicoapi.proderj.rj.gov.br/saude/atendimento</p><p>Link 2) https://servicoapi.proderj.rj.gov.br/consulta/rede/endpoint/local</p>', 100, '2023-11-24 20:59:17', '2023-11-24 20:59:17', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(33, 20, '<p>1. Agora, ao invés da senha transparente, deve ser enviada a conversão em MD5 ao webservice.</p><p>2. Mantido a liberação dos campos para as seguintes funcionalidades:</p><p> . Circulação &gt;&gt; Receber Lote; e</p><p> . Circulação &gt;&gt; Agendar Recebimento;</p><p>3. Após a reunião com os técnicos do TJRJ, foi observado que a pilha de consultas: </p><p> . webservice; e</p><p> . proxy_pj;</p><p>Deveriam ter um tratamento diferente do que estava escrito em seu backend.</p><p> . Antes: Buscava no webservice, não encontrava nada, iria ao proxy_pj.</p><p> . Agora: Recebe a requisição, divide as buscas de forma assíncrona. Traz o resultado ao ControladorLote.php utilizando a função popularCamposInclusaoAjax(). </p><p>4. Nenhuma outra parte do código foi alterada, bem como não recomendo tentar manipular as cadeias e dependências do sistema, com risco de quebra parcial ou total do sistema em homologação.</p>', 101, '2023-11-24 21:04:57', '2023-11-24 21:04:57', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(34, 20, '<p>Abaixo do carrossel "Veja a lista completa de noticias"</p><p># tela da lista de noticias = Drupal</p><p># Selecionar a noticia como destaque</p><p># Definição de perfis</p><p># Painel Administrativo terá tela</p><p>Áreas definidas que podem postar</p><p>Não permitir mais de um comentário por assunto</p><p>Upload para comunicados e noticias</p><p>Agenda - Incorporar resultados e cadastros ao Google</p><p># Eles tem isso implementado em algum local?</p><p>Carrossel apenas noticias 100%</p><p>Menus de ate 10 registros e 10 submenus</p><p>Comunicados fixos por assunto/setor (Ver Boletim)</p><p>Comunicados usa as divisões do Boletim</p><p>Comunicados não tem validade</p><p>Comunicados são 5 fixos</p><p>Comunicados são 5 ordem publicação</p><p>Comunicados com alerta ativo a quantidade de acesso</p><p>10 acesso rápidos menu lateral</p><p>Editar endereço do rodapé</p><p>Editar ícones e links das redes sociais</p><p>Criar Acervo de ícones</p>', 106, '2023-11-29 10:08:27', '2023-11-29 10:08:27', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(35, 30, '<p><br></p><p>Pesquisar sobre onde está o servidor e ter acesso a ele para poder fazer as alterações solicitadas.</p>', 108, '2023-11-29 13:54:49', '2023-11-29 13:54:49', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(36, 30, '<p>Entrei em contato com a Carla que me forneceu todas as informações que me foram solicitadas</p>', 108, '2023-11-29 13:55:20', '2023-11-29 13:55:20', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
