	(159, 20, '<p><span style="color: black;">Tudo que envolve TJ e ALERJ, Eu daria prioridade máxima, pois são serviços que envolvem os 3 (Três) Poderes:</span></p><p><span style="color: black;"> </span></p><p><span style="color: black;"> Executivo com o PRODERJ prestando o serviço,</span></p><p><span style="color: black;"> Legislativo com a ALERJ, e&nbsp;</span></p><p><span style="color: black;"> Judiciário com o TJ.&nbsp;</span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">Esses sistemas que prestam algum tipo de ligação com outro poder, não deveria ser ignorado desde 2013, no caso do Deposito Público. Parando pela simples falta de atualização da versão da linguagem.</span></p>', 334, '2024-01-28 13:28:57', '2024-01-28 13:28:57', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
