	(161, 20, '<p>Venho por meio deste solicitar o Deploy Total da Aplicação do QLIKADMIN que se encontra na pasta: 10.11.62.138/qse para o servidor de Produção.</p><p>Dica: Todas as alterações se encontram na pasta 10.11.62.138/qse/app. Se essa pasta foi enviada para o Deploy, além de ser mais rápido, garante a integridade do sistema.</p><p>&nbsp;</p><p><strong>Motivo do DEPLOY</strong>: Ajuste em etapas.</p>', 337, '2024-01-28 13:43:16', '2024-01-28 13:43:16', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(162, 20, '<p>Entrega Noticias</p><p><br></p><p>E-mail: </p><p><br></p><p><span style="color: black;">Prezados, conforme confirmado pelo SGTP, o modulo de notícias está entregue, conforme conversado pelo João, estamos confirmando a entrega do módulo, solicitamos testes por algum responsável, caso tenha alguma alteração, será realizada após as próximas entregas.</span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">Link: </span><a href="https://intranet.degase.proderj.rj.gov.br/intranet/noticia/endpoint/listar" rel="noopener noreferrer" target="_blank" style="color: black;">https://intranet.degase.proderj.rj.gov.br/intranet/noticia/endpoint/listar</a></p><p>&nbsp;</p><p><span style="color: black;">Estamos à disposição para eventuais dúvidas.</span></p>', 209, '2024-01-28 13:50:54', '2024-01-28 13:50:54', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(163, 20, '<p><strong style="color: red;">Segue a lista e o TAP:</strong></p><ul><li><span style="color: red;">VERIFICAR O BEM APÓS SEPARAÇÃO, ELE DEVE CONTINUAR A EDIÇÃO. O SISTEMA NÃO ESTÁ PERMITINDO. pode ser colocxado o perfil master.</span></li><li><span style="color: red;">RETIRAR AVALIAÇÃO ANTES DOS 90 DIAS DO LEILÃO (Não é relevante)</span></li><li><span style="color: red;">RETIRAR - Menu Auditoria (Auditar Inventário, Definir Inventário, Registrar Contagem) – DPERJ NÃO ESTÁ UTILIZANDO</span></li><li><span style="color: red;">&nbsp;verificar se existe relatório de lotes que já foram inutilizados (Ano ou Período);</span></li><li><span style="color: red;">REVISAR O RECEBIMENTO DE LOTES E BENS COM ACESSO SIMULTÂNEO E CONCORRENTE; evitar duplicação de Lotes;</span> <strong>Gustavo deve verificar e avaliar. Atualmente o DPERJ exclui o Lote duplicado que não tem bem.</strong></li></ul><p><br></p>', 339, '2024-01-28 14:01:52', '2024-01-28 14:01:52', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(164, 20, '<p>Oriento a buscar a definição de Sistema Legado, analisar todas as vulnerabilidades e Problemas relacionado a busca e acesso ao TJ devido as atuais vulnerabilidades antes de solicitar atualizações Evolutivas. </p>', 339, '2024-01-28 14:04:50', '2024-01-28 14:04:50', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(165, 20, '<p>CVE-2013-1643. O analisador SOAP em PHP antes de 5.3.23 e 5.4.x antes de 5.4.13 permite que invasores remotos leiam arquivos arbitrários por meio de um arquivo SOAP WSDL contendo uma declaração de entidade externa XML em conjunto com uma referência de entidade, relacionada a uma entidade externa XML (XXE ) nas funções soap_xmlParseFile e soap_xmlParseMemory.</p><p><br></p>', 339, '2024-01-28 14:06:17', '2024-01-28 14:06:17', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(166, 20, '<p>CVE-2013-1635, publicado: 2013-03-06, atualizado: 2014-01-28, com o risco nível 7.5 de 10. ext/soap/soap.c em PHP antes de 5.3.22 e 5.4.x antes de 5.4.13 não valida o relacionamento entre a diretiva soap.wsdl_cache_dir e a diretiva open_basedir, que permite que invasores remotos ignorem as restrições de acesso pretendidas acionando a criação de arquivos SOAP WSDL armazenados em cache em um diretório arbitrário.</p><p><br></p>', 339, '2024-01-28 14:06:25', '2024-01-28 14:06:25', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(167, 20, '<p>CVE-2013-1635, publicado: 2013-03-06, atualizado: 2014-01-28, com o risco nível 7.5 de 10. ext/soap/soap.c em PHP antes de 5.3.22 e 5.4.x antes de 5.4.13 não valida o relacionamento entre a diretiva soap.wsdl_cache_dir e a diretiva open_basedir, que permite que invasores remotos ignorem as restrições de acesso pretendidas acionando a criação de arquivos SOAP WSDL armazenados em cache em um diretório arbitrário.</p><p><br></p>', 339, '2024-01-28 14:06:38', '2024-01-28 14:06:38', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(168, 20, '<p>As consultas por banco de dados e Autenticação no GTC podem ser afetados pela CVE-2011-3182, publicada em 2011-08-25, atualizada: 2017-08-29. O PHP anterior a 5.3.7 não verificava adequadamente os valores de retorno das funções de biblioteca malloc, calloc e realloc, o que permite que invasores dependentes de contexto causem uma negação de serviço (de referência de ponteiro NULL e travamento do aplicativo) ou acionem um estouro de buffer aproveitando a capacidade de fornecer um valor arbitrário para um argumento de função, relacionado a:</p><p>(1) ext/curl/interface.c,</p><p>(2) ext/date/lib/parse_date.c,</p><p>(3) ext/date/lib/parse_iso_intervals.c ,</p><p>(4) ext/date/lib/parse_tz.c,</p><p>(5) ext/date/lib/timelib.c,</p><p>(6) ext/pdo_odbc/pdo_odbc.c,</p><p>(7) ext/reflection/php_reflection.c,</p><p>(8) ext/soap/php_sdl.c,</p><p>(9) ext/xmlrpc/libxmlrpc/base64.c,</p><p>(10) TSRM/tsrm_win32.c e</p><p>(11) a função strtotime.</p><p><br></p>', 339, '2024-01-28 14:06:56', '2024-01-28 14:06:56', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(169, 20, '<p>Venho por meio deste solicitar o Deploy Total da Aplicação do QLIKADMIN que se encontra na pasta: 10.11.62.138/qse para o servidor de Produção.</p><p>Dica: Todas as alterações se encontram na pasta 10.11.62.138/qse/app. Se essa pasta foi enviada para o Deploy, além de ser mais rápido, garante a integridade do sistema.</p><p><br></p><p><strong>Motivo do DEPLOY</strong>: RESET da APLICAÇÃO.</p>', 340, '2024-01-28 16:53:02', '2024-01-28 16:53:02', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
