	(175, 20, '<p>Conforme orientado, para separar os chamados de forma ordenada, venho por meio deste solicitar a criação de novo ambiente de produção para aplicação Web em Framework Laravel (PHP) com <strong style="background-color: yellow; color: red;">Certificado SSL</strong>:</p><p><strong style="background-color: yellow; color: black;">Produção (Destino):</strong><strong> Nome sugerido</strong></p><p><strong style="background-color: yellow; color: black;">https://qlikapi.rj.gov.br</strong></p><p>O ambiente para aplicação web deverá seguir as mesmas características do BATIS (ambiente de HOMOLOGAÇÃO):</p><p>Servidor Linux.</p><p>Esse chamado esta sendo solicitado após o atendimento do Chamado - ID 102063 (Proderj &gt; PRODERJ).</p>', 349, '2024-01-28 17:37:54', '2024-01-28 17:37:54', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
