	(177, 20, '<p>Solicito Deploy Total da Aplicação do QLIKADMIN, de Homologação para <strong style="background-color: yellow; color: black;">Produção</strong>.</p><p><strong>"path": "/qse",</strong></p><p><strong>Motivo:</strong> Alteração de Tratamento de caractere para exclusão de etapas.</p><p><strong>OBS:</strong> Após testes realizados as o <strong style="background-color: yellow; color: red;">histórico de justificativas</strong><span style="background-color: yellow; color: red;"> </span>se encontram disponíveis através da View "v_justification_history", que pode ser consumida pelo QLIK SENSE ENTERPRISE, conforme houver necessidade. A Sub Aplicação (QLIKADMIN) também lista esse histórico.</p>', 351, '2024-01-28 17:46:58', '2024-01-28 17:46:58', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(178, 20, '<p><span style="color: black;">Que trata de documentação necessária para a segurança da informação. </span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">Boa tarde Mestre Nycolas,</span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">Venho pelo presente e-mail, solicitar a indispensável atenção desta Gerencia de Infraestrutura e Serviços, quanto a necessidade da avaliação do serviço de APIs desenvolvido por esta Fabrica de Software para atuar junto com a ferramenta do </span><strong style="color: black;">Qlik Sense Enterprise</strong><span style="color: black;"> na exibição de dados estratégicos do PRODERJ.</span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">O anexo tem como objetivo principal, fornecer dados sobre o projeto. O Chamado encontra-se no título desta mensagem. </span></p>', 352, '2024-01-28 17:50:49', '2024-01-28 17:50:49', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
