	(184, 20, '<p>Tarefa será abortada até a definição do SSO ou Importação da Base antiga passada.</p>', 197, '2024-01-29 11:06:00', '2024-01-29 11:06:00', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(185, 19, '<p>25/01/24 - Eu junto com a Elaine começamos os testes dentro do openshift, testamos nas seguintes aplicações: ADMPENITENCIARIA, CRASE e LEÃO XIII, ambas sem sucesso de reconhecimento da nova versão, solicitamos ajuda ao José Maciel e ao Diretor Joacy, porem ambos estavam presos na migração do SEI e não puderam ajudar de imediato.</p>', 317, '2024-01-29 11:32:08', '2024-01-29 11:32:08', '14', 'GianLucca de Oliveira Augusto', NULL, NULL, 1, NULL),
	(186, 20, '<p><span style="color: black;">1) Data e Hora de Conclusão de Etapas com Dia/Mês/Ano Hora:Min</span></p><p><span style="color: black;">2) Criação de nova regra para o Campo Não entregue: </span></p><p><span style="color: black;"> Quando data final for menor que a data atual, mesmo que o sistema não tenha uma data de conclusão, o sistema deve apresentar como Entregue no Prazo : NÃO. </span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">3) Em hipótese alguma o sistema deve apresentar a data e hora da justificativa no campo Justificativa da Licitação. </span></p><p><span style="color: black;">&nbsp;</span></p><p><span style="color: black;">4) Caso o sistema possua uma justificativa em uma de suas etapas e o usuário concluir com a justificativa em branco a etapa limpará a justificativa. </span></p>', 372, '2024-01-29 21:10:55', '2024-01-29 21:10:55', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(187, 20, '<p>A partir deste Card de Tarefa as mesmas serão separadas por funcionários, qd as mesmas não estiverem com as mesmas metas e prazos. </p>', 172, '2024-01-30 10:55:15', '2024-01-30 10:55:15', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(188, 19, '<p>Foi verificado que houve uma atualização, em 10/01, às 13:26h por Davyson Daniell ( Funcionario da propria CEHAB ) por algum motivo, o botão foi \'apagado\' da página.</p><p>Provavelmente uma ação involuntária, mas que acarretou neste problema de \'desabilitar\' o botão e, consequentemente, não conseguia seguir para a página que realiza a impressão do boleto, erro corrigido.</p>', 381, '2024-01-30 16:58:55', '2024-01-30 16:58:55', '14', 'GianLucca de Oliveira Augusto', NULL, NULL, 1, NULL),
	(189, 19, '<p> 31/01/24 - Itens já realizados:</p><p>1 - Aumento do tamanho dos arquivos de PDF.</p><p>2 - Remoção da obrigatoriedade das fotos da capa para a notícia.</p><p>3 - Remover do menu institucional o item institucional teste</p><p>4 - Liberar a possibilidade de colocar mais de um arquivo de vídeo por página.</p>', 390, '2024-01-31 14:28:28', '2024-01-31 14:28:28', '14', 'GianLucca de Oliveira Augusto', NULL, NULL, 1, NULL),
