	(262, 20, '<p>Analise dos arquivos : </p><p>gdp\\models\\modeloleilao.php</p><p>gdp\\controllers\\ControladorLeilao.php</p><p>gdp\\controllers\\ControladorAlienarLote.php</p><p>gdp\\core\\CORE_Relatorio.php</p><p><br></p><p>Buscando relação com o Status: $leilao-&gt;status</p><p>Com algum método que encerre o Leilão sem que o Cliente solicite</p>', 610, '2024-03-26 11:59:57', '2024-03-26 11:59:57', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(263, 20, '<p><br></p><p> <a href="https://redmine.extremedigital.com.br/issues/126404" rel="noopener noreferrer" target="_blank">Catálogo #126404</a>: Realizar Manutenção / Suporte Soluções e Sistemas (preventivo, perfectivo ou corretivo) de média complexidade [SEPLAG/DEPOSITO/PUBLICO] - Criação de Script que Lista Tabela Leilão e Tabela Lotes com Status 2:00 Script: http://10.11.62.153:8081/dss/depositophp53/-/blob/DEV/Documentacao2/SQL/view_leilao_lote.sql </p><p>SELECT </p><p> Leilao.ano AS `le_ano`, </p><p> Leilao.numero AS `le_numero`, </p><p> Leilao.data AS `le_data`, </p><p> Leilao.status AS `le_status`, </p><p> Lotes.ano AS `lo_ano`, </p><p> Lotes.id_lote AS `lo_id_lote`, </p><p>... Script muito LONGO para o campo.</p><p>FROM </p><p> Lotes </p><p>JOIN </p><p> Leilao ON Lotes.id_leilao = Leilao.id_leilao </p><p>ORDER BY </p><p> Leilao.ano DESC, </p><p> Leilao.numero DESC, </p><p> Lotes.id_lote DESC;</p><p>Eu e Everaldo da GAR estamos testando Leilões que estão com status F (Fechados) e Listando os lotes para testar adição.</p>', 610, '2024-03-26 14:56:48', '2024-03-26 14:56:48', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
