	(272, 19, '<p>BANNERS:</p><p>- Mudar a posição do banner principal para ficar antes das notícias, logo abaixo do menu horizontal. Reduzir o tamanho do banner para colocar um outro ao lado. Link para colocar nesse novo banner: &lt;https://www.saude.rj.gov.br/laudos&gt;</p><p><br></p><p><br></p><p>SLIDES \'SERVIÇOS\' e \'INFORMAÇÕES EM SAÚDE\':</p><p>- Mudar a posição dos dois e colocar logo abaixo de NOTÍCIAS</p><p><br></p><p><br></p><p>LINKS PARA O SLIDER PRINCIPAL:</p><p>- CIS RJ / Monitora &lt;http://monitorar.saude.rj.gov.br/&gt;</p><p>- VEM DOAR / Hemorio &lt;http://www.hemorio.rj.gov.br/&gt;</p><p>- A Saúde é feita de gente que cuida de gente &lt;https://www.saude.rj.gov.br/rede-de-atendimento&gt;</p><p>- SAMU &lt;https://secsaude.proderj.rj.gov.br/samu-bases&gt;</p><p>- Doe mais vida / RJ Transplantes &lt;http://www.doemaisvida.rj.gov.br/&gt;</p>', 613, '2024-04-01 10:12:08', '2024-04-01 10:12:08', '14', 'GianLucca de Oliveira Augusto', NULL, NULL, 1, NULL),
