	(274, 20, '<p><br></p><p> <a href="https://redmine.extremedigital.com.br/issues/126408" rel="noopener noreferrer" target="_blank">Catálogo #126408</a>: Solucionar problema de média complexidade [DEGASE/INTRANET - Teste de todo perfil Master e Limpeza de Codigo</p><p>Ultima atualização do Painel de Edição de Menu: </p><p>src\\app\\Views\\intranet\\menu\\main.php </p><p>src\\app\\Views\\intranet\\menu\\form_atualizar.php </p><p>src\\app\\Views\\intranet\\menu\\form_field.php </p><p>Atualização de Marcação de Debug: </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse_acesso_rapido.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse_assunto.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse_comunicado.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse_noticia.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse_redes_sociais.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\painel\\master\\main_collapse_rodape.php </p><p>Marcação de DEBUG para qd o desenvolvedor não tiver acesso ao PLUGIN de DEBUG PHP.</p>', 601, '2024-04-01 16:41:10', '2024-04-01 16:41:10', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(275, 20, '<p>www\\intranetdegase\\src\\app\\Views\\intranet\\menu\\form_atualizar.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\menu\\form_cadastrar.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\menu\\form_field.php </p><p>www\\intranetdegase\\src\\app\\Views\\intranet\\menu\\main.php</p><p>Modal com erro para a criação de Subbmenu</p>', 601, '2024-04-01 16:41:50', '2024-04-01 16:41:50', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(276, 20, '<p><br></p><p> <a href="https://redmine.extremedigital.com.br/issues/126408" rel="noopener noreferrer" target="_blank">Catálogo #126408</a>: Solucionar problema de média complexidade [DEGASE/INTRANET] - Inicio de Documentação, Texto para acrescimo de Painel de Edição de Menu Redação para ser revisada antes de ser levado para documentação: </p><p>Repositório: http://10.11.62.153:8081/dss/intranetdegase/-/tree/DEV/Documentacao/DocumentacaoTecnica/Menu</p><p><br></p><p>O Modelo de Entidade e Relacionamento (MER) apresentado na imagem descreve a estrutura de um banco de dados com quatro entidades principais: profile_menu_object, menu_object, profile, e slug_menu. Aqui está um resumo no formato de documentação:</p><p><br></p><p>Entidades:</p><p>1. profile_menu_object</p><p>id_profile_menu_object: int (Chave Primária)</p><p>order: int</p><p>slug_profile_id: varchar(50) (Chave Estrangeira para profile.slug_profile)</p><p>slug_menu_id: varchar(50) (Chave Estrangeira para menu_object.slug_menu)</p><p>DataAprovacao: date</p><p>created_at: datetime</p><p>updated_at: datetime</p><p>deleted_at: datetime</p><p>2. menu_object</p><p>id_slug_menu: varchar(50) (Chave Primária)</p><p>label: varchar(50)</p><p>order: int</p><p>position: varchar(50)</p><p>url: varchar(255)</p><p>blank: varchar(50)</p><p>created_at: datetime</p><p>updated_at: datetime</p><p>deleted_at: datetime</p><p>3. profile</p><p>id_slug_profile: varchar(80) (Chave Primária)</p><p>label: varchar(80)</p><p>created_at: datetime</p><p>updated_at: datetime</p><p>deleted_at: datetime</p><p>id_perfil: varchar(45)</p><p>4. slug_menu</p><p>id_slug_menu: varchar(50) (Chave Primária)</p><p>label: varchar(50)</p><p>order: int</p><p>position: varchar(50)</p><p>url: varchar(255)</p><p>blank: varchar(50)</p><p>created_at: datetime</p><p>updated_at: datetime</p><p>deleted_at: datetime</p><p>Relacionamentos:</p><p>profile_menu_object tem um relacionamento com profile através da chave estrangeira slug_profile_id.</p><p>profile_menu_object tem um relacionamento com menu_object através da chave estrangeira slug_menu_id.</p><p><br></p><p>Observações:</p><p>As entidades menu_object e slug_menu parecem ter uma estrutura semelhante, o que pode indicar uma relação de herança ou uma repetição desnecessária.</p><p>Todos os objetos têm atributos de auditoria (created_at, updated_at, deleted_at), permitindo rastrear a criação, atualização e exclusão lógica de registros.</p><p>Motivo das três colunas repetidas reflete a :</p><p>1) Exclusão logica: Onde temos data em "Deletado em" o registro não é apresentado no sistema.</p><p>2) "Atualizado em" e "Criado em" em cada tabela registra individualmente cada status de um registro.</p><p>A entidade profile contém um campo id_perfil que não está conectado explicitamente a outras entidades no MER apresentado.</p><p>Não temos vinculo com a tabela de perfil, mas temos validações e campos de seleção baseados na tabela.</p>', 601, '2024-04-02 08:52:30', '2024-04-02 08:52:30', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(277, 20, '<p>Atualizações tipo refactor restantes: </p><p><br></p><p>Remoção de POP ups (Previsão: de 16hs de Trabalho a dois dias úteis);</p><p>Persistência de Tela em colapse após a atualização (Previsão: 22hs de Trabalho a 3 dias úteis);</p><p><br></p><p><br></p><p>Teste restantes: </p><p><br></p><p>Atualização de novo servidor de banco de dados;</p><p>Testes de Edição e Adição de Notícias;</p><p>Testes de Edição e Adição de Comunicados;</p><p>Testes de Edição e Adição de Assunto;</p><p>Testes de Edição e Adição de Acesso Rápido;</p><p>Testes de Edição e Adição de Redes Sociais;</p><p>Testes de Edição e Adição de Rodapé;</p><p><br></p><p>OBS: Os mesmos testes podem ter a colaboração do Cliente caso seja necessário para agilizar o Deploy em Produção. </p><p><br></p>', 622, '2024-04-02 20:24:17', '2024-04-02 20:24:17', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
