	(299, 20, '<p>Foram testados todos os Perfis;</p><p> MASTER e ADM (dois testes de cada item abaixo):</p><p> Repetido o Checklist com todos os perfis nos seguintes modulos:</p><p> Acesso Rápido: Cadastrar, Atualizar, Excluir;</p><p> Assunto: Cadastrar, Atualizar, Excluir;</p><p><br></p><p> MASTER e ASCOM (dois testes de cada item abaixo):</p><p> Noticia: Cadastrar, Atualizar, Excluir;</p><p><br></p><p> MASTER e COMUN (dois testes de cada item abaixo):</p><p> Comunicado: Cadastrar, Atualizar, Excluir;</p><p><br></p><p> MASTER e ADM (dois testes de cada item abaixo):</p><p> Rede Social: Cadastrar, Atualizar, Excluir;</p><p> Rodapé: Cadastrar, Atualizar, Excluir;</p><p><br></p><p>Foram realizados deploys múltiplos em tempo real para o ambiente de Homologação; </p><p><br></p><p>Foram corrigidas permissões de leitura e escrita no banco de dados em PRD e HML;</p><p><br></p><p>Foram corrigidos permissão de leitura e escrita de pastas somente em HML;</p>', 622, '2024-04-05 21:34:23', '2024-04-05 21:34:23', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
	(300, 20, '<p>Das 9hs até as 18:30 em Homologação o Colaborador BRUNO realizou os testes de qualidade, observações de inconformidades de tamanhos e responsividade, bem como analisou os testes que realizei em Desenvolvimento. </p><p><br></p><p>Às 18:30 a Equipe de Infra e GBD foram acionadas ao mesmo Tempo: </p><p><br></p><p>ATENDE: 112 667&nbsp;[DEGASE/INTRANET] - Deploy parcial de Intranet. Atendido pela Funcionária Lenize (Infra); </p><p>ATENDE: 112 700 Migrar Base de Dados (DEGASE/INTRANET). Atendido pelo Funcionário Anderson (Banco de dados). </p><p><br></p><p>A Ação dos dois Chamados fora síncronos, com testes de conexão de banco e DEBUG para testes. </p><p><br></p><p>Agradeço a todos os envolvidos pelas ações em conjunto. </p><p><br></p><p><br></p><p><br></p>', 622, '2024-04-05 21:34:33', '2024-04-05 21:34:33', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
