	(323, 20, '<p><strong><u>Ponto 1</u></strong> - O Desenvolvedor não possui acesso ao Código fonte em produção, justamente para que o PRODERJ tenha a segurança de que o código fonte não será alterado sem que para isso haja um pedido de DEPLOY via ATENDE;&nbsp;</p><p><br></p><p><strong><u>Ponto 2</u></strong> - Para que o DEPLOY de Homologação para Produção ocorra é necessário que um terceiro elemento além do desenvolvedor realize os testes do sistema em sua totalidade para verificar se houve alguma alteração indevida ou não planejada;</p><p><br></p><p><strong><u>Ponto 3</u></strong> - O Sistema possui um LOG de acesso a tela que deverá ser observado caso haja algum acesso de um ou mais funcionários, o desenvolvedor trata do código e não das informações inseridas, bem como alterações que ocorram durante o processo de utilização em produção;&nbsp;</p>', 713, '2024-05-02 08:05:08', '2024-05-02 08:05:08', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
