	(328, 20, '<p>Observando que para que as novas regras sejam transportadas imediatamente para o painel o usuário ou o operador da sala deve após a conclusão de todas as etapas da licitação, retornar para a tela de lista licitações para que o Painel do QLIK possa ser atualizado. O Procedimento e tempo, dependem do processo de atualização de ambos os ambientes (Sistema de Licitações e Painel do Contrato QLIK SENSE ENTERPRISE). </p>', 718, '2024-05-02 08:16:17', '2024-05-02 08:16:17', '15', 'Gustavo de Melo Hammes', NULL, NULL, 1, NULL),
