	(330, 23, '<p>* Contrato Locação de Condutores mudar Numero para Numero de Contrato na tela de listar (Filtro)//</p><p>* edição orgão com erro ao salvar//</p><p>* trovar nome cadastro tipo ocorrencia para tipo de acidente//</p><p>* cpf aceita letra quando edita funcionario//</p><p>* campo nome funcionario aceita numero//</p><p>* ao cadastrar usuario não volta para lista//</p><p>* em Criar Contrato Locação de Dispositivo MUDAR para Criar Contrato Locação de Veículo (dentro da tela de formulario)//</p><p>* Contrato Locação de Condutores mudar Numero para Numero de Contrato na tela de listar (Filtro)//</p><p>* relatórios: trocar inserido por cadastrado e filtro em Log de alterações Cadastrais//</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', 737, '2024-05-08 17:08:00', '2024-05-08 17:08:00', '18', 'Kaylan Rocha Freitas Rosa', NULL, NULL, 1, NULL),
