	(337, 30, '<p>Surgiu uma demanda urgente de alteração na página da SES com objetivo de dar destaque na divulgação dos Indicadores Precoces da Covid e SRAG.</p><p><br></p><p>Para isso gostariamos de alterar os botões na parte de cima da página inicial substituíndo o botão da COVID por um novo com a legenda COVID e SRAG&nbsp;(Encaminho a imagem&nbsp;<span style="background-color: rgb(255, 255, 255); color: inherit;">&nbsp;</span><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">do novo botão&nbsp;</span>em anexo).</p><p>A link a ser disponobilizado neste botão seria o seguinte:&nbsp;<a href="https://cievssesriodejaneiro.shinyapps.io/painel_covid/" rel="noopener noreferrer" target="_blank">https://cievssesriodejaneiro.shinyapps.io/painel_covid/</a>&nbsp;</p><p>Além disso o botão referente a VIGIDESASTRES seria removido.</p><p><br></p><p><br></p><p><br></p>', 744, '2024-05-09 09:54:10', '2024-05-09 09:54:10', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
	(338, 30, '<p>Gostaria de informar que um evento está agendado para o dia 07/05/2024, na Secretaria de Saúde.</p><p><br></p><p>Para garantir a máxima visibilidade e participação, solicitamos gentilmente a inclusão de um Pop Up na tela inicial no site da Extranet, conforme o anexo enviado.</p><p><br></p><p><strong style="background-color: white; color: black;">Link</strong><span style="background-color: white; color: black;">:&nbsp;</span><a href="https://extranet.saude.rj.gov.br/" rel="noopener noreferrer" target="_blank" style="background-color: white; color: black;">https://extranet.saude.rj.gov.br/</a></p>', 745, '2024-05-09 10:08:58', '2024-05-09 10:08:58', '25', 'Nilton Ricardo Pimentel Silva', NULL, NULL, 1, NULL),
