	(426, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">1- Fechamento de Período ( Desloga após&nbsp;</span><span style="background-color: rgb(255, 255, 255); color: rgb(0, 90, 149);">ter</span><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">&nbsp;liberado o pagto e não permite acessar para gerar o relatório agrupado)</span></p>', 1047, '2024-07-16 08:48:32', '2024-07-16 08:48:32', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
	(427, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">1.1 - Fechamento de período - Liberar função para os responsáveis pelo convênio da SEGOV;</span></p><p><br></p><p>HUGO COQUE CASCARDO<span style="color: rgb(0, 90, 149);">COQUE.PMERJ@GMAIL.COM</span>21972000545RESPONSAVEL-CONVENIOLEANDRO DAS NEVES JORGE<span style="color: rgb(0, 90, 149);">neves.d@pm.rj.gov.br</span>21981171641RESPONSAVEL-CONVENIOMarcio Barroso Pereira<span style="color: rgb(0, 90, 149);">sigsegov@gmail.com</span>21994138924RESPONSAVEL-CONVENIOMARIA CRISTINA CHAVES<span style="color: rgb(0, 90, 149);">crischavessegov@gmail.com</span>21996513391RESPONSAVEL-CONVENIO</p><p>CHRISTIANA GOMES DA SILVA<span style="color: rgb(0, 90, 149);">chrisgomes.segov@gmail.com</span>21992041142RESPONSAVEL-CONVENIO</p>', 1047, '2024-07-16 08:48:55', '2024-07-16 08:48:55', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
	(428, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">2 - Erro na função bloqueados ( histórico de bloqueio) dos servidores que faltaram no SP. ( Não conseguimos tirar a cor amarela e entrar na consulta do bloqueio)</span></p>', 1047, '2024-07-16 08:49:11', '2024-07-16 08:49:11', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
	(429, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">3 - Relatório de histórico mensal (Anteriormente a entrada da SP, emitíamos o relatório na opção PROES EVENTOS com todas as unidades e dias do mês. Após entrada do SP, apenas a SP é</span></p>', 1047, '2024-07-16 08:49:18', '2024-07-16 08:49:36', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, '2024-07-16 08:49:36'),
	(430, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">3 - Relatório de histórico mensal (Anteriormente a entrada da SP, emitíamos o relatório na opção PROES EVENTOS com todas as unidades e dias do mês. Após entrada do SP, apenas a SP é listada, as demais unidades agrupa em uma única linha o total das vagas.)</span></p>', 1047, '2024-07-16 08:49:45', '2024-07-16 08:49:45', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
	(431, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">4 - Habilitar a CONSULTA (não permitir editar) dados dos servidores e relatórios gerenciais para os responsáveis pelo convênio da SEGOV;</span></p>', 1047, '2024-07-16 08:49:51', '2024-07-16 08:49:51', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
	(432, 17, '<p><span style="background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);">5 - Ajustar o nível de acesso para os servidores da divisão de RAS da SEAP. Liberar o maior acesso para todos os servidores que trabalham na divisão.</span></p><ol><li><span class="ql-cursor">﻿</span>Brenda Cavalcante Cordeiro, CPF&nbsp;<a href="about:blank" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 90, 149);">159.072.567-02</a></li><li>Patricia Hernandes de Souza, CPF&nbsp;<a href="about:blank" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 90, 149);">058.083.017-93</a></li><li>Nataly Barreiro Teixeira, CPF&nbsp;<a href="about:blank" rel="noopener noreferrer" target="_blank" style="color: rgb(0, 90, 149);">141.691.567-22</a></li></ol><p><br></p>', 1047, '2024-07-16 08:50:06', '2024-07-16 08:50:06', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
