	(494, 19, '<p><strong>1)</strong>&nbsp;Apontar o ícone de Instagram para o link :&nbsp;&nbsp;<a href="http://instagram.com/rioprevidencia" rel="noopener noreferrer" target="_blank" style="color: rgb(12, 136, 42);"><u>http://instagram.com/rioprevidencia</u></a>&nbsp;- ok</p><p><strong>2)</strong>&nbsp;Colocar um&nbsp;<strong>ícone</strong>&nbsp;do X (antigo tweeter), apontando para o link :&nbsp;<a href="https://twitter.com/rioprevidencia" rel="noopener noreferrer" target="_blank" style="color: rgb(237, 92, 87);"><u>https://twitter.com/rioprevidencia</u></a></p><p><strong>3)</strong>&nbsp;<strong>Alteração do título da página</strong>: Atualmente, o título exibe ‘<strong>Welcome | Rio Previdência</strong>’. Deve ser realizada a tradução de ‘Welcome’ para ‘<strong>Bem-vindo’</strong>&nbsp;e a correção da abreviação do nome do órgão, resultando em:&nbsp;‘<strong>Bem-vindo | Rioprevidência’</strong>. - ok</p><p><strong>4) Retirar a opção "Acesso à Informação" - ok</strong></p><p><strong>5)&nbsp;&nbsp;</strong>Retirar os itens&nbsp;<strong><em>Contracheques&nbsp;</em></strong>e&nbsp;<strong><em>Informes de Rendimentos</em></strong>&nbsp;do&nbsp;<strong>Menu Transparência</strong>, pois eles já existem no&nbsp;<strong>Menu Serviço - ok</strong></p><p><strong>6)</strong>&nbsp;Ordenar os itens de Transparência conforme designado no Guia de Transparência Ativa da CGE: -ok</p><p><strong style="color: rgb(12, 136, 42);">7)&nbsp;</strong><span style="color: rgb(12, 136, 42);">Colocar as outras opções de Transparência&nbsp;</span><strong style="color: rgb(12, 136, 42);">após</strong><span style="color: rgb(12, 136, 42);">&nbsp;os itens de Transparência do Guia de Transparência Ativa da CGE: - ok</span></p><p><strong>8)&nbsp;</strong>Criar um PopUp na tela principal, alterável por nós do Rioprevidência, podendo habilitá-lo quando necessário.</p>', 1174, '2024-08-12 17:49:41', '2024-08-12 17:49:41', '14', 'GianLucca de Oliveira Augusto', NULL, NULL, 1, NULL),
