	(566, 15, '<p>Campos que precisam ser implementados no cadastro de veículos:</p><ul><li><strong>pesquisa</strong> deve abranger todos os veículos em todos os órgãos ao qual o usuário tem acesso. Incluir os campos: Placa antiga e Renavan (Placa, Chassis, e Numero de Ordem já estão inclusos). Incluir também checkbox com opções de filtro Próprio, Não Próprio, Placa Fictícia/Equipamento.</li><li><strong>UF</strong> já existe, está relacionada à placa ou locação do veículo?</li><li><strong>Número do contrato</strong></li><li><strong>Fundamento</strong> (SEI de origem): campos de texto e upload de arquivo</li><li><strong>Ocorrência:</strong> Cadastro, Ativação, Inativação, Devolução, Roubo/Furto, Relotação, Inservível</li><li><strong>Condição/Status:</strong> o que esse campo deve receber?</li><li><strong>Tipo de veículo</strong> “Executivo ou Administrativo”: mantém?</li><li><strong>Nova Placa</strong></li><li><strong>Proprietário</strong>: quem pode ser proprietário?</li><li><strong>CNPJ Proprietário</strong></li><li><strong>Espécie</strong>: o que esse campo deve receber?</li><li><strong>Categoria</strong>: particular, oficial ou aluguel (<strong>Categoria</strong> existente no cadastro deve ser modificado para <strong>Tipo de Veículo</strong>)</li><li><strong>CRV</strong>: o que esse campo deve receber?</li><li><strong>Pasta CRV</strong>: o que esse campo deve receber?</li><li><strong>Inventário</strong>: o que esse campo deve receber?</li><li><strong>Classificação e DVO</strong>: deve estar disponível apenas na consulta? (Esmaecido na imagem de referência, não parece ser um campo editável)</li><li><strong>Prefixo</strong>: o que esse campo deve receber?</li><li><strong>CV</strong>: o que esse campo deve receber?</li><li><strong>Frota</strong>: o que esse campo deve receber?</li><li><strong>Subfrota</strong>: o que esse campo deve receber?</li><li><strong>QTD TQ</strong>: o que esse campo deve receber?</li><li><strong>CAP TQ</strong>: Capacidade do tanque em litros?</li><li><strong>COMB 2</strong>: Adicionar novo campo Combustível, o cadastro deverá ter 2 campos para esse dado.</li><li><strong>Tacógrafo</strong>:</li><li><strong>Responsável pela Frota</strong>: no cadastro existe</li><li><strong>Cidade emplacamento</strong></li><li><strong>Cidade Lotaçã</strong>o</li><li><strong>Empresa</strong>: Locadora???</li><li><strong>Placa substituída</strong>: ??</li><li><strong>Número do Cartão</strong>: o que esse campo deve receber?</li><li><strong>OB</strong>: Observação(campo de texto livre)?</li><li><strong>Envio P/ CTF</strong>: deve estar disponível apenas na consulta? o que esse campo deve receber?</li><li><strong>Vale Card</strong>: deve estar disponível apenas na consulta? o que esse campo deve receber?</li><li><strong>Ultimo abastecimento</strong></li></ul><p>Campos que precisam ser alterados:</p><ul><li><strong>Vínculo</strong>: Locado, Comodato, Locado Blindado, Locado Provisório, Cedido, Outros)</li><li><strong>Categoria</strong> deve ser modificado para <strong>Tipo de Veículo</strong></li><li>Número de Ordem muda para Ordem de serviço ou são dados diferentes?</li></ul><p><br></p>', 1234, '2024-08-30 09:33:34', '2024-08-30 09:33:34', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
