	(635, 15, '<p>Exemplo: ao tentar salvar um cadastro que possui algum campo inválido, o sistema dá uma mensagem de erro para que os campos sejam corrigidos, porém o campo \'Marca\', embora pareça preenchido, precisa ser preenchido novamente, e o campo \'Modelo\' fica visivelmente vazio necessitando também ser preenchido novamente.</p>', 1353, '2024-09-30 13:35:48', '2024-09-30 13:35:48', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
	(636, 15, '<p>Se o limite por Classificação já tiver sido atingido, o sistema deve avisar ao usuário sobre o limite atingido.</p>', 1355, '2024-09-30 13:38:06', '2024-09-30 13:38:06', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
	(637, 15, '<p>Se o limite por Classificação já tiver sido atingido, o sistema deve avisar ao usuário sobre o limite atingido.</p>', 1355, '2024-09-30 13:38:06', '2024-09-30 13:38:06', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
	(638, 15, '<p>Independente do órgão onde o usuário está inserido, ou seu perfil de acesso,  ele tem acesso a cadastro de usuários, funcionários, inclusive consegue criar um usuário Master.</p>', 1356, '2024-09-30 14:33:49', '2024-09-30 14:33:49', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
	(639, 15, '<p>DVO - Todos os Órgãos devem ter por padrão as três classificações: Representação, Serviço e Operacional no campo DVO (hoje são adcionadas sub-classificações). Cada classificação manterá o campo de quantidade para preencher o limite de veículos. A soma total de quantidade de veículos permitida deve ser fornecida na tela do DVO.Essa informação será utilizada no REQ-36. As sub-classificações não serão mais adicionadas manualmente no DVO do órgão.</p>', 1337, '2024-09-30 15:10:25', '2024-09-30 15:10:25', '10', 'Elaine Delgado Alves', NULL, NULL, 1, NULL),
