	(658, 1, '<p>Data:&nbsp;&nbsp;&nbsp;&nbsp;11/10/2024&nbsp;&nbsp;&nbsp;Comentário:&nbsp;&nbsp;&nbsp;[SEPLAG/NOVODEPOSITO] – Deploy&nbsp;&nbsp;&nbsp;</p><p>8 Horas de trabalho.&nbsp;&nbsp;&nbsp;commit realizado posteriormente à data b892676d5d39e949df1bae8cdc9dfd9ba8116c3c (HEAD -&gt; main, origin/main, origin/HEAD) Author: Gustavo Hammes &lt;gustavo.hammes@extreme.digital&gt; Date:&nbsp;&nbsp;Sun Oct 13 20:05:45 2024 -0300&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;REFACTOR - Refatoração de código que não corrige um bug nem adiciona um recurso.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;docker-compose.yml src/app/Config/App.php src/app/Config/Constants.php src/app/Config/Database.php src/app/Config/Routes.php src/app/Controllers/AgendamentoApiController.php src/app/Controllers/AgendamentoDbController.php src/app/Controllers/AgendamentoEndpointController.php ... Continua anexo</p><p><br></p>', 1406, '2024-10-14 10:50:07', '2024-10-14 10:50:07', '1', 'root', NULL, NULL, 1, NULL),
	(659, 1, '<p>[SEPLAG/DEPOSITO/LEGADO] - Coreção de BUGs encaminhados pela (GAR/PRODERJ). Erro no cabeçalho de envio.&nbsp;&nbsp;&nbsp;&nbsp;</p><p>8 horas de tyrabalho &nbsp;&nbsp;&nbsp;Sustentando sistema legado, desenvolvido em PHP 5.3 e CodeIgniter 3, sujeito a sérias vulnerabilidades devido à obsolescência dessas tecnologias, que não recebem mais atualizações de segurança. Isso inclui exposição a ataques como injeção de código, falhas na proteção de sessões e o uso de funções deprecadas. Durante a correção dos problemas relatados nos anexos foi verificado que o CodeIgniter 3 não adota práticas modernas como namespaces e possui limitações na prevenção de SQL Injection. A manutenção do sistema nesta configuração compromete sua segurança e confiabilidade, tornando necessária uma atualização urgente para versões mais recentes e seguras de PHP e frameworks modernos.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p><br></p>', 1407, '2024-10-14 10:53:38', '2024-10-14 10:53:38', '1', 'root', NULL, NULL, 1, NULL),
	(660, 1, '<p>[SEPLAG/DEPOSITO/LEGADO] - Coreção de BUGs encaminhados pela (GAR/PRODERJ). CORE_Relatório.php&nbsp;&nbsp;&nbsp;</p><p>8 horas de trabalho.&nbsp;&nbsp;&nbsp;A falta de organização e tipagem adequada de variáveis em sistemas legados facilita a exploração de CVEs, comprometendo a segurança com ataques como SQL Injection e DoS. A ausência de criptografia forte e senhas seguras no MySQL aumenta o risco, e a atualização de uma linguagem desatualizada em um sistema abandonado é altamente complexa, muitas vezes exigindo uma reescrita completa devido a incompatibilidades e vulnerabilidades inerentes ao código antigo. CORE_Relatório.php. Falha ao carregar variáveis, devido a falha na estrutura LEGADA. </p><p><br></p>', 1407, '2024-10-14 10:53:38', '2024-10-14 10:53:38', '1', 'root', NULL, NULL, 1, NULL),
	(661, 1, '<p>[SEPLAG/DEPOSITO/LEGADO] - Coreção de BUGs encaminhados pela (GAR/PRODERJ). Erros em requisição no Modal.&nbsp;&nbsp;&nbsp;&nbsp;</p><p>8 horas de trabalho.&nbsp;&nbsp;&nbsp;Os BUGs em sistemas web legados geralmente são causados por funções obsoletas de linguagens de programação e pela falta de implementação de medidas de segurança modernas, como criptografia robusta e o uso de senhas fortes no MySQL, que aumentam a exposição a ataques de negação de serviço (DoS) e outras falhas de segurança. Além disso, vulnerabilidades conhecidas e exploráveis, como as catalogadas nas CVEs, podem ser aproveitadas para comprometer o sistema. A falta de atualização de infraestruturas, amarradas a versões antigas que não suportam upgrades, agrava ainda mais esses problemas, tornando a manutenção e a segurança mais difíceis. Framework Codeigniter 3.2 apresentando dificuldades.</p><p><br></p>', 1407, '2024-10-14 10:53:38', '2024-10-14 10:53:38', '1', 'root', NULL, NULL, 1, NULL),
	(662, 1, '<p>07/10/2024&nbsp;&nbsp;&nbsp;Comentário:&nbsp;&nbsp;&nbsp;[SEPLAG/DEPOSITO/LEGADO] - Coreção de BUGs encaminhados pela (GAR/PRODERJ).&nbsp;&nbsp;&nbsp;</p><p>8 horas&nbsp;&nbsp;&nbsp;Os BUGs em sistemas web legados surgem, em grande parte, pela impossibilidade de atualizar infraestruturas presas a versões predefinidas, que não permitem upgrades devido a restrições de compatibilidade. Isso deixa o sistema vulnerável a falhas conhecidas e exploráveis, como as catalogadas nas Common Vulnerabilities and Exposures (CVEs), que podem ser usadas para ataques de negação de serviço (denial of service – DoS). Além disso, infraestruturas inadequadas, com processamento insuficiente ou desatualizado, sobrecarregam os servidores e comprometem a comunicação com sistemas externos, agravando a exposição a vulnerabilidades e falhas críticas de interoperabilidade, dificultando a manutenção e operação contínua desses sistemas. Bugs no anexo destaca problemas com objetos montados com Banco de dados. </p><p><br></p>', 1407, '2024-10-14 11:46:58', '2024-10-14 11:46:58', '1', 'root', NULL, NULL, 1, NULL),
