	(707, 17, '<p>Criar/Liberar Vagas de RAS Noturno para TODAS as Unidades do Departamento</p><p><br></p><p>Disponibilizar para o perfil do servidor "LIMA" a autorização para:</p><p>Editar o sistema quando criar eventos</p><p><br></p><p>&nbsp;Excluir de eventos</p><p><br></p><p>&nbsp;Criar vagas de RAS Noturno (vide Atividade 1)</p><p>Ativar a opção ANEXO no campo RAS COMPULSÓRIO</p><p><br></p><p>Ativar a opção ACESSO no campo CENTRAL DE BLOQUEIOS</p><p><br></p><p>Bloquear parcialmente os servidores na opção CENTRAL DE BLOQUEIOS</p><p><br></p><p>Liberar acesso a SETRAS para desbloquear no sistema em caso de falta justificada ou não dos servidores</p><p><br></p><p>Liberar Acesso Administrativo e Operacional para Levantamento de Consulta e para lançamentos</p><p><br></p><p>Liberar Acesso para cadastrar Diretores das Unidades, com nível exclusivo para confirmar presença e outros</p><p><br></p><p>Liberar Acesso para fechar o período e emitir planilha agrupada CSV para pagamento do RAS, liberando a opção “AGRUPAR”</p><p><br></p><p>Disponibilizar Acesso para Perfil EXCLUSIVO dos Diretores de Unidades, para acompanhamento e emissão de:</p><p>Confirmar de Presenças e Faltas dos servidores</p><p>Liberar Relatórios de Presenças e Faltas dos Servidores</p><p><br></p><p>Liberar Relatórios Analíticos de Voluntários (DIÁRIO/MENSAL)</p><p><br></p><p>Liberar Consultas às Inscrições de Voluntários realizadas nas Unidades</p><p>Criar Nova Funcionalidade para Esclarecimentos de Dúvidas Referentes ao Sistema</p><p><br></p><p>Alteração / Ajustes da Carga Horária para 120 horas</p>', 1476, '2024-10-30 09:36:27', '2024-10-30 09:36:27', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
	(708, 17, '<p>Problema em fazer um novo lançamento</p><p><br></p><p>Fechamento do RAS</p><p><br></p><p>Relatórios de Agrupados Liberado</p><p><br></p><p><br></p>', 1477, '2024-10-30 09:43:53', '2024-10-30 09:43:53', '12', 'Fabrício Gonçalves Silva', NULL, NULL, 1, NULL),
