	(875, 87, '<p><strong>1.&nbsp;&nbsp;</strong>&nbsp;&nbsp;Aba <strong><u>Períodos:</u></strong></p><p><br></p><p>1.1.&nbsp;&nbsp;&nbsp;Campo <strong>Nome (Unidade)</strong> não está funcionando. Quando digita e sai do campo, o que foi digitado “apaga”.</p><p><br></p><p>1.2.&nbsp;&nbsp;&nbsp;Campo <strong>Município</strong> aceitando números e caracteres especiais</p><p><br></p><p>1.3.&nbsp;&nbsp;&nbsp;Os campos que filtram <strong>inicio do período</strong> e <strong>término do período</strong> não deveriam trazer todos os resultados na data filtrada? Exemplo: </p><p>Se filtrar início do período: 01/01/2024 e término do período: 31/12/2024 não deveria trazer todos os dados que iniciam e terminam nessas datas? Se sim, isso não está acontecendo. </p><p>Só funciona se colocar início do período e término do período exatos. Caso contrário, aparece a seguinte mensagem:</p><p><br></p><p>1.4.&nbsp;&nbsp;&nbsp;Botão “<strong>Consultar</strong>” não está funcionando. Ao clicar no botão, aparece o seguinte erro:</p><p class="ql-align-center"><br></p><p><strong>2.&nbsp;&nbsp;&nbsp;&nbsp;<u>Cadastrar Período:</u></strong></p><p><br></p><p><em>2.1.&nbsp;&nbsp;&nbsp;</em>Não é possível escolher o dia 01 de janeiro. Mensagem de erro: “<em>O campo inicio do período deve estar dentro do 1º semestre. Verifique se o Campo Ano informado esta correto</em>”</p><p><br></p><p>2.2.&nbsp;&nbsp;&nbsp;Mesmo com o campo <strong>Ano</strong> preenchido, aparece o seguinte erro:</p><p><br></p><p>2.3.&nbsp;&nbsp;&nbsp;<strong>Início do período</strong> pode ser maior que o <strong>término do período</strong>.</p><p><br></p><p><em>Obs: Devido ao problema 2.2, não foi possível saber se teria alguma crítica após clicar em </em><strong><em>salvar</em></strong><em>. </em></p><p><br></p><p>2.4.&nbsp;&nbsp;&nbsp;Após preencher o início do período e o término do período, é possível alterar o período e ano sem nenhuma crítica.</p><p><br></p><p><em>Obs: Devido ao problema 2.2, não foi possível saber se teria alguma crítica após clicar em </em><strong><em>salvar</em></strong><em>.&nbsp;</em></p><p><br></p><p>Relatório completo, com detalhes, enviado dia 12/12/24 às 09:26.</p>', 1783, '2024-12-12 22:37:21', '2024-12-12 22:37:21', '82', 'Magno Vieira Neto', NULL, NULL, 1, NULL),
	(876, 87, '<p class="ql-align-center"><strong><u>Área de qualidade (QA) – GFS/PRODERJ</u></strong></p><p><em>Desenvolvido por: Magno Veiga Neto – magno.neto@proderj.rj.gov.br</em></p><p>Visão Geral</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;A criação de uma área de Qualidade (QA) proporcionará benefícios significativos a GFS, como maior eficiência nos processos, redução de erros e aprimoramento da experiência dos clientes/usuários. Essa área funcionará como uma barreira de proteção, garantindo que sistemas e sites entregues estejam alinhados às expectativas e minimizando o risco de falhas.</p><p>Os principais benefícios incluem:</p><ul><li><strong>Redução de Custos:</strong> Identificar problemas antes da liberação evita retrabalho e custos extras.</li><li><strong>Agilidade nas Entregas:</strong> Processos bem estruturados e padronizados tornam o desenvolvimento mais eficiente.</li><li><strong>Maior Credibilidade:</strong> Sistemas com alta qualidade aumentam a confiança dos cidadãos e demais stakeholders.</li><li><strong>Conformidade:</strong> Garante que todos os projetos sigam normas e requisitos pré-estabelecidos.</li><li><strong>Satisfação do Usuário/Cliente:</strong> Experiência positiva aumenta a percepção de valor nos serviços oferecidos pela PRODERJ ao governo, funcionários e cidadãos.</li></ul><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Embora ainda seja uma área em fase inicial, é essencial planejar a incorporação da qualidade de softwares nos projetos da GFS, ressaltando sua importância estratégica. Para isso, é fundamental contar com uma equipe especializada, ferramentas de automação adequadas e a participação ativa da área de QA em todas as etapas dos projetos. Com essa abordagem, o setor de QA não apenas garantirá maior eficiência e confiabilidade nos sistemas, mas também se consolidará como um diferencial estratégico, agregando valor ao PRODERJ e aos serviços prestados à sociedade.</p>', 1786, '2024-12-12 23:51:02', '2024-12-12 23:51:02', '82', 'Magno Vieira Neto', NULL, NULL, 1, NULL),
	(877, 87, '<p>Estrutura do Projeto</p><p><strong>Premissas</strong></p><ol><li><strong>Documento GAR:</strong> Todas as demandas enviadas para a área de QA devem ser acompanhadas do "GAR" (Guia de Análise de Requisitos), que detalha as solicitações dos usuários.</li><li><strong>Envolvimento da QA:</strong> A equipe de QA deve ser envolvida antes de qualquer liberação ao usuário final.</li><li><strong>Prontidão para Testes:</strong> A área de QA apenas realiza testes em projetos liberados como prontos pelos analistas/desenvolvedores.</li><li><strong>Base de Referência:</strong> Todos os novos projetos devem seguir a lista de verificação padronizada (checklist) e serem avaliados em conjunto com o documento do GAR.</li></ol><p class="ql-align-center"><br></p>', 1786, '2024-12-12 23:51:02', '2024-12-12 23:51:02', '82', 'Magno Vieira Neto', NULL, NULL, 1, NULL),
	(878, 87, '<p><strong>Lista de Verificação Padronizada (Checklist)</strong></p><p><strong>1. Links</strong></p><ul><li>Verificar funcionamento e redirecionamento correto.</li><li>Identificar e corrigir links quebrados (404).</li></ul><p><strong>2. Botões e Ações</strong></p><ul><li>Certificar-se que todos os botões e menus de navegação estão funcionando corretamente.</li></ul><p><strong>3. APIs</strong></p><ul><li>Validar integrações e retorno correto de dados.</li></ul><p><strong>4. Upload/Download</strong></p><ul><li>Testar uploads e downloads quanto à funcionalidade e validade dos arquivos.</li></ul><p><strong>5. Layout e Responsividade</strong></p><ul><li>Testar consistência visual em diferentes dispositivos e navegadores.</li><li>Garantir responsividade em dispositivos móveis.</li></ul><p><strong>6. Estética e Design</strong></p><ul><li>Conferir alinhamento com diretrizes de design (cores, fontes, espaçamentos, etc.).</li></ul><p><strong>7. Velocidade de Carregamento</strong></p><ul><li>Avaliar tempo de carregamento das páginas principais.</li></ul><p><strong>8. Compatibilidade com Navegadores</strong></p><ul><li>Testar nos principais navegadores (Chrome, Firefox, Safari, Edge, etc.).</li></ul><p><strong>9. Dispositivos</strong></p><ul><li>Testar em dispositivos variados (smartphones, tablets, desktops).</li><li>Avaliar compatibilidade com diferentes sistemas operacionais.</li></ul><p><strong>10. Facilidade de Navegação</strong></p><ul><li>Verificar clareza e simplicidade da navegação.</li></ul><p><strong>11. Mensagens de Erro</strong></p><ul><li>Garantir clareza e utilidade das mensagens exibidas.</li></ul><p><strong>12. Interatividade</strong></p><ul><li>Testar funcionalidade de elementos interativos (menus, botões, formulários).</li></ul><p><strong>&nbsp;</strong></p><p><strong>13. Validação de Requisitos</strong></p><ul><li>Conferir implementação conforme o GAR e requisitos acordados.</li></ul><p><strong>14. Documentação GAR</strong></p><ul><li>Confirmar conformidade entre os testes realizados e o GAR.</li></ul><p class="ql-align-center"><br></p>', 1786, '2024-12-12 23:51:02', '2024-12-12 23:51:02', '82', 'Magno Vieira Neto', NULL, NULL, 1, NULL),
	(879, 87, '<p>Ferramentas</p><p>Algumas ferramentas open source estão sendo testadas para QA e futuramente serão incorporadas nos testes de qualidade. Alguma delas são:</p><ul><li><strong>Selenium:</strong> Automação de testes para aplicações web.</li><li><strong>JMeter:</strong> Testes de carga e performance.</li><li><strong>Postman:</strong> Testes de APIs.</li><li><strong>Cucumber:</strong> Testes baseados em comportamento (BDD).</li><li><strong>TestLink:</strong> Gerenciamento de testes.</li><li><strong>Appium:</strong> Testes de aplicativos móveis.</li><li><strong>SonarQube:</strong> Análise de código para garantir qualidade e segurança.</li></ul><p class="ql-align-center"><br></p>', 1786, '2024-12-12 23:51:02', '2024-12-12 23:51:02', '82', 'Magno Vieira Neto', NULL, NULL, 1, NULL),
	(880, 87, '<p>Conclusão:</p><p><br></p><p>Este plano fornece as diretrizes necessárias para estruturar e operacionalizar a área de QA na GFS, melhorando a qualidade em todos os sistemas e soluções fornecidos pela GFS. Com base em processos bem definidos, uso de tecnologia apropriada e equipe qualificada, a expectativa é de ganhos significativos em eficiência e satisfação dos clientes/usuários.</p>', 1786, '2024-12-12 23:51:02', '2024-12-12 23:51:02', '82', 'Magno Vieira Neto', NULL, NULL, 1, NULL),
	(881, 91, '<p>Alterações do tipo RAW:&nbsp;</p><p><br></p><p>RAW - Commits to tipo raw indicam mudanças relacionadas a arquivos de configurações, dados, features, parâmetros.</p><p><br></p><p><strong>Commit: acc12862be40a47f70c6cc6334e90b0f36ff6519</strong></p><p><br></p><p><span style="color: var(--text-secondary-color);">src\\app\\Views\\fia\\ptpa\\camposValidacao\\</span><span style="color: rgb(246, 248, 250);">AppCapAtend.php</span></p><p><br></p><p>Revisão dos erros apontados pelo colaborador Magno Veiga Neto. (Documento de Unidades)</p>', 1767, '2024-12-13 12:27:19', '2024-12-13 12:27:19', '86', 'Caio Nunes Marinho', NULL, NULL, 1, NULL),
	(882, 91, '<p>Alterações do tipo FEATURE:&nbsp;</p><p><br></p><p>FEATURE - Commit para adicionar um novo recurso ou funcionalidade ao sistema.</p><p><br></p><p><strong>Commit: 5f1936ec495a160a4093b993da5024f40e37bad1</strong></p><p><br></p><p><span style="color: var(--text-secondary-color);">src\\app\\Views\\fia\\ptpa\\camposValidacao\\</span><span style="color: rgb(246, 248, 250);">AppMunicipioFiltro.php</span></p><p><span style="color: var(--text-secondary-color);">src\\app\\Views\\fia\\ptpa\\camposValidacao\\</span><span style="color: rgb(246, 248, 250);">AppNomeUnidadeFiltro.php</span></p><p><span style="color: var(--text-secondary-color);">src\\app\\Views\\fia\\ptpa\\periodo\\</span><span style="color: rgb(246, 248, 250);">AppForm.php</span></p><p><span style="color: var(--text-secondary-color);">src\\app\\Views\\fia\\ptpa\\periodo\\</span><span style="color: rgb(246, 248, 250);">AppListar.php</span></p><p><br></p><p>Revisão dos erros apontados pelo colaborador Magno Veiga Neto. (Documento de Período)</p>', 1767, '2024-12-13 12:27:54', '2024-12-13 12:27:54', '86', 'Caio Nunes Marinho', NULL, NULL, 1, NULL),
