	(890, 85, '<p><br></p>', 1796, '2024-12-17 09:27:51', '2024-12-17 09:27:55', '80', 'Arthur do Nascimento Quintella', NULL, NULL, 1, '2024-12-17 09:27:55'),
	(891, 85, '<ul><li> Todos os links internos e externos funcionam corretamente.</li><li> Botões e CTAs (Call to Action) executam as ações esperadas.</li><li> Formulários enviam informações e validam dados corretamente (campos obrigatórios, formatos válidos).</li><li> Funcionalidades de login, registro e recuperação de senha funcionam corretamente.</li><li> O sistema de busca retorna resultados relevantes.</li><li> Carrosséis, sliders e pop-ups abrem e fecham conforme esperado.</li><li> Integração com redes sociais (compartilhamento, ícones de links) está funcional.</li><li> Notificações e mensagens de erro/sucesso aparecem no momento certo e são claras.</li></ul><h3><strong>2. Compatibilidade de Navegador e Dispositivos</strong></h3><ul><li> O site funciona corretamente nos navegadores principais (Chrome, Firefox, Edge, Safari).</li><li> O site é responsivo em dispositivos móveis, tablets e desktops.</li><li> Teste em diferentes resoluções de tela (Full HD, HD, etc.).</li><li> Recursos interativos funcionam corretamente em touch screens.</li></ul><h3><strong>3. Performance e Velocidade</strong></h3><ul><li> O site carrega em menos de 3 segundos.</li><li> Imagens estão otimizadas para a web (formato, resolução, tamanho).</li><li> Recursos como vídeos e scripts carregam sem atrasos excessivos.</li><li> Verificação com ferramentas como Google PageSpeed Insights ou GTmetrix.</li></ul><p> 4.UI/UX</p><ul><li> Navegação intuitiva: o usuário consegue encontrar informações em no máximo 3 cliques.</li><li> O design é consistente em todo o site (tipografia, cores, botões).</li><li> O conteúdo é legível (boas práticas de espaçamento, tamanho de fonte, contraste).</li><li> Erros 404 e páginas não encontradas exibem mensagens amigáveis.</li><li> O fluxo de compra/cadastro (para e-commerce) é simples e direto.</li><li> Testar acessibilidade com ferramentas como WAVE ou Lighthouse.</li></ul><p><br></p>', 1796, '2024-12-17 09:27:57', '2024-12-17 09:27:57', '80', 'Arthur do Nascimento Quintella', NULL, NULL, 1, NULL),
