	(990, 85, '<ul><li><strong>2 de janeiro</strong>:</li><li class="ql-indent-1">Revisão do escopo inicial do sistema.</li><li class="ql-indent-1">Teste do banco de dados (tabelas para usuários, funcionários, períodos e unidades). AGUARDANDO DRUPAL</li><li class="ql-indent-1">Teste do módulo de cadastro de usuários (fron e backend).</li><li><strong>3 de janeiro</strong>:</li><li class="ql-indent-1">Testes unitários no módulo de cadastro de usuários.</li><li class="ql-indent-1">Teste de validações no back (e.g., campos obrigatórios, formatos de e-mail e senha).</li><li><strong>6 de janeiro</strong>:</li><li class="ql-indent-1">Teste do módulo de cadastro de funcionários.</li><li class="ql-indent-1">Teste de funções reutilizáveis para validações e segurança.</li><li><strong>7 de janeiro</strong>:</li><li class="ql-indent-1">Testes no módulo de funcionários, incluindo integração com o banco de dados.</li><li class="ql-indent-1">Teste da interface gráfica para o cadastro de períodos e unidades.</li><li><strong>8 de janeiro</strong>:</li><li class="ql-indent-1">RETeste e revisão de código e correção de bugs identificados nos testes.</li><li class="ql-indent-1">Planejamento das melhorias para a próxima semana.</li><li><strong>9 de janeiro</strong>:</li><li class="ql-indent-1">Teste do módulo de cadastro de períodos.</li><li class="ql-indent-1">Teste de uma interface para exibição e gerenciamento de períodos cadastrados.</li><li><strong>10 de janeiro</strong>:</li><li class="ql-indent-1">Testes no módulo de períodos: validações, desempenho e compatibilidade com diferentes navegadores.</li><li class="ql-indent-1">Teste de filtros para busca de períodos.</li><li class="ql-indent-1">Teste do módulo de cadastro de unidades.</li><li class="ql-indent-1">Teste de Integração entre módulos (usuários, funcionários, períodos e unidades).</li></ul><p><br></p>', 1867, '2025-01-17 08:56:21', '2025-01-17 08:56:21', '80', 'Arthur do Nascimento Quintella', NULL, NULL, 1, NULL),
