	(1008, 91, '<p>Alterações do tipo RAW :&nbsp;</p><p><br></p><p>RAW - Commits to tipo raw indicam mudanças relacionadas a arquivos de configurações, dados, features, parâmetros.</p><p><br></p><p><strong>Commit: 4e40b215005e0d61aa729ebe725e277d7df90cc8</strong></p><p><br></p><p><span style="color: var(--text-secondary-color);">src\\app\\Controllers\\</span><span style="color: rgb(246, 248, 250);">AdolescenteDbController.php</span></p><p><br></p><p>Alterações do tipo REFACTOR :&nbsp;</p><p><br></p><p>REFACTOR - Refatoração de código que não corrige um bug nem adiciona um recurso.</p><p><br></p><p><strong>Commit: 2d8c29f29310e416d374d1be37e8c269b5196354</strong></p><p><br></p><p><span style="color: var(--text-secondary-color);">src\\app\\Controllers\\</span><span style="color: rgb(246, 248, 250);">AdolescenteApiController.php</span></p><p><span style="color: var(--text-secondary-color);">src\\app\\Controllers\\</span><span style="color: rgb(246, 248, 250);">AdolescenteDbController.php</span></p><p><span style="color: var(--text-secondary-color);">src\\app\\Views\\fia\\ptpa\\adolescentes\\</span><span style="color: rgb(246, 248, 250);">AppForm.php</span></p>', 1889, '2025-01-21 15:48:22', '2025-01-21 15:48:22', '86', 'Caio Nunes Marinho', NULL, NULL, 1, NULL),
