	(1115, 91, '<p>Reunião com a GAR:</p><p><br></p><p>Reunião com Wallace:</p><p><br></p><p>Formulário Psicossocial são dois formulários com médias em suas respostas e não valores acumulativos. Tenho um modelo de Analise de Riscos do TPVAT que podemos tentar usar.&nbsp;</p><p>Deploy de Sexta-feira, dia 21 de fev está valido para ser testado pela GAR.&nbsp;</p><p>Criação de Perfil pelo Painel de Segurança Ok</p><p>Criação de Cargo pelo Painel de Segurança Ok</p><p>Criação de Regra de Segurança (Perfil+Cargo) DEV, Ok</p><p>Exclusão de Regra de Segurança (Perfil+Cargo) DEV. Prazo Sexta-Feira</p><p>Ações de Aprovar ou reprovar regra de Segurança, até Sexta-Feira</p><p>Teste do painel de Segurança, até dia 7 de Março.&nbsp;</p><p><br></p><p>GAR:&nbsp;</p><p><br></p><p>Documento Formulário Psicosocial;</p><p>Teste de Homologação</p><p>Reunião na Quinta Feira</p><p>Documento de Período</p>', 2024, '2025-02-25 13:28:55', '2025-02-25 13:31:49', '86', 'Caio Nunes Marinho', NULL, NULL, 1, '2025-02-25 13:31:49'),
	(1116, 91, '<p>Estudo do projeto SGC.</p><p><br></p><p>Reunião com a GAR/ Wallace:</p><p>Formulário Psicossocial são dois formulários com médias em suas respostas e não valores acumulativos. Tenho um modelo de Analise de Riscos do TPVAT que podemos tentar usar.&nbsp;</p><p>Deploy de Sexta-feira, dia 21 de fev está valido para ser testado pela GAR.&nbsp;</p><p>Criação de Perfil pelo Painel de Segurança Ok</p><p>Criação de Cargo pelo Painel de Segurança Ok</p><p>Criação de Regra de Segurança (Perfil+Cargo) DEV, Ok</p><p>Exclusão de Regra de Segurança (Perfil+Cargo) DEV. Prazo Sexta-Feira</p><p>Ações de Aprovar ou reprovar regra de Segurança, até Sexta-Feira</p><p>Teste do painel de Segurança, até dia 7 de Março.&nbsp;</p><p>&nbsp;</p><p>GAR:&nbsp;</p><p>Documento Formulário Psicosocial;</p><p>Teste de Homologação</p><p>Reunião na Quinta Feira</p><p>Documento de Período</p>', 2024, '2025-02-25 13:31:43', '2025-02-25 13:31:43', '86', 'Caio Nunes Marinho', NULL, NULL, 1, NULL),
