CREATE TABLE IF NOT EXISTS `vinculo` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `carga_horaria` int NOT NULL,
  `empresa_id` int unsigned DEFAULT NULL,
  `funcao_id` int unsigned DEFAULT NULL,
  `colaborador_id` int unsigned DEFAULT NULL,
  `data_inicio` date DEFAULT NULL,
  `data_fim` date DEFAULT NULL,
  `segunda` tinyint DEFAULT NULL,
  `terca` tinyint DEFAULT NULL,
  `quarta` tinyint DEFAULT NULL,
  `quinta` tinyint DEFAULT NULL,
  `sexta` tinyint DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_by_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated_by` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `updated_by_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '1',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `vinculo_empresa_id_index` (`empresa_id`),
  KEY `vinculo_funcao_id_index` (`funcao_id`),
  KEY `vinculo_colaborador_id_index` (`colaborador_id`),
  CONSTRAINT `vinculo_colaborador_id_foreign` FOREIGN KEY (`colaborador_id`) REFERENCES `colaborador` (`id`),
  CONSTRAINT `vinculo_empresa_id_foreign` FOREIGN KEY (`empresa_id`) REFERENCES `empresa` (`id`),
  CONSTRAINT `vinculo_funcao_id_foreign` FOREIGN KEY (`funcao_id`) REFERENCES `funcao` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


